				'ECS is seeking a React Developer to work in our Washington, DC office .\n\nJob Description:\n\nECS is seeking a TS-cleared React Developer to support one of our mission critical programs for the Department of Justice. We offer the chance to support the world’s finest law enforcement organization and help the people that keep us safe. In this job you will support agents, analysts, and professionals and technology they use to fight terrorism, espionage, cyber-attacks, and major criminal threats.\n\nWe are seeking candidates committed to high quality to provide courteous and accurate technical information. As a React Developer, you will collaborate with customers, often engaging directly with non-technical personnel, to understand their data related needs, suggest solutions, and complete work in a timely manner. This position performs activities associated with implementation, integration, and support of computer systems in mission-critical response operations environment.\n\nResponsibilities:\n• Design and develop User Interfaces (UIs) and UI components using React.\n• Design and implement key front-end features and services.\n• Develop and optimize user-facing features and services.\n• Develop software/applications using AWS technologies.\n• Design, code, test, and debug applications and software solutions.\n• Troubleshoot, debug, and optimize code and interface software/applications.\n• Gather and evaluate user feedback and make recommendations for improvement.\n• Analyze system capabilities to resolve problems.\n\nRequired Skills:\n• Bachelor’s degree in Computer Science, Information Systems, Engineering, or a related technical discipline\n• Active Top Secret with SCI eligibility\n• 4+ years overall hands-on application programming experience\n• 3+ years of experience designing and implementing User Interfaces (UIs) and UI components\n• 3+ years of demonstrated coding experience in React\n• Solid foundational knowledge, understanding and experience with JavaScript\n• 2+ years Cloud experience (AWS preferred)\n• Experience optimizing front-end performance and features\n• Significant knowledge and experience with SQL and NoSQL databases\n• Experience working with source control systems like Git, Gitlab in an application development environment\n• Working knowledge and experience with Agile Scrum methodology\n\nDesired Skills:\n• AWS Certification.\n• Experience with implementing scalability within an AWS Cloud infrastructure.\n• Willingness to learn new skills and technologies on the fly.\n• Ability to communicate with customers to refine requirements.\n• Being a team player, willing to transparently collaborate with technical SMEs.\n\nECS is an equal opportunity employer and does not discriminate or allow discrimination on the basis of race, color, religion, sex, age, sexual orientation, gender identity or expression, national origin, ancestry, citizenship, genetic information, registered domestic partner status, marital status, status as a crime victim, disability, protected veteran status, or any other characteristic protected by law. ECS promotes affirmative action for minorities, women, disabled persons, and veterans.\n\nECS is a leading mid-sized provider of technology services to the United States Federal Government. We are focused on people, values and purpose. Every day, our 3800+ employees focus on providing their technical talent to support the Federal Agencies and Departments of the US Government to serve, protect and defend the American People.',
