			job_description:
				'Description\n\nThere’s never been a more exciting time to join United Airlines! We’re on a path towards becoming the best airline in the history of aviation. Our shared purpose – Connecting People, Uniting the World – is about more than getting people from one place to another. It also means that as a global company that operates in hundreds of locations around the world with millions of customers and tens of thousands of employees, we have a unique responsibility to uplift and provide opportunities in the places where we work, live and fly, and we can only do that with a truly diverse and inclusive workforce. And we’re growing – in the years ahead, we’ll hire tens of thousands of people across every area of the airline. Our careers include a competitive benefits package aimed at keeping you happy, healthy and well-traveled. From employee-run "Business Resource Group" communities to world-class benefits like parental leave, 401k and privileges like space available travel, United is truly a one-of-a-kind place to work. Are you ready to travel the world?\n\nWe believe that inclusion propels innovation and is the foundation of all that we do. United\'s Digital Technology team spans the globe and is made up of diverse individuals all working together with pioneering technology to build the best airline in the history of aviation. Our team designs, develops and maintains massively scaling technology solutions brought to life with innovative architectures, data analytics, and digital solutions.\n\nJob overview and responsibilities\n\nThe Senior Developer plays a Critical role in creating and maintaining the strategic partnership between business needs and technology delivery. The Senior Developer\'s role is to lead the efforts to plan, design, develop and launch efficient systems and solutions in support of core organizational functions. This individual will apply proven communication, analytical and problem-solving skills to help identify, communicate and resolve issues, opportunities or problems in order to enhance the benefit of IT and Business investments. The Principal Developer is highly experienced and has decision-making authority. The Principal Developer is self - sufficient, requires no direct supervision, and mentors/coaches others. The Principal Developer has extensive knowledge/experience across multiple technologies and business areas.\n• Leads the design, development, and planning for solutions and technology standards to solve complex business problems\n• Hands-on development, Support and solve software systems as required, optimizing performance, resolving problems, and providing follow-up on all issues and solutions\n• Collaborate with back-end developers to define required services and implement solutions using these services\n• Responsible for full development life cycle from planning through successful release and support\n• Mentor and assist in the training and onboarding of new team members\n• Participate in code reviews to maintain high quality, well architected code\n• Consults across multiple United Information Technology projects and technology areas to perform fixes, problem management, root-cause analysis, and solution implementation\n• Serves as a resource for technology/project development review and technical assessments\n• Provide consultation and technical leadership in project life cycle planning\n• Ensures consistency and coherence to the enterprise standards and guiding principles throughout the application lifecycle\n• Finds opportunities to leverage/influence the direction for existing infrastructure and application components\n• Understands and applies the enterprise vision and strategy to the project solution while balancing tactical needs to deliver\n• Partner with various business and IT collaborators in defining domain architecture strategy\n\nUnited Airlines is an equal opportunity employer. United Airlines recruits, employs, trains, compensates, and promotes regardless of race, religion, color, national origin, gender identity, sexual orientation, physical ability, age, veteran status, and other protected status as required by applicable law.\nQualifications\n\nRequired\n• Bachelors in Computer Science/Information Technology or related field\n• 5+ years of experience in in full-stack development with a focus on React, Typescript, and Node.js\n• Proficient in web development using React, Redux, ES6, Node.js, HTML5, CSS3\n• 5+ years of experience with common front-end development tools such as Babel, Webpack, NPM, etc.\n• 5 + years of experience building web applications with Micro frontend architecture\n• 5+ years of experience in design patterns and enterprise standards in application design\n• A deep understanding of accessibility fundamentals and its applications in creating robust user interfaces\n• Experience with unit testing\n• Understands Technology systems & applications\n• Exceptional at coding and on time delivery of quality components and or applications\n• Exceptional at triage or analysis of situations for production support\n• Effective participant of requirements gathering, requirements analysis\n• Must be legally authorized to work in the United States for any employer without sponsorship\n\nPreferred\n• Experience developing rest apis using c#\n• Cloud technologies AWS including CDN\n• UI Analytics (Google Analytics, Quantum Metrics)\n• Application performing tools\n• Git/GitHub Code repositories\n\nAirline Maintenance systems development is a PLUS\n\nEqual Opportunity Employer - Minorities/Women/Veterans/Disabled/LGBT',
