				'Sr. React Developer (Hybrid)\n\nLocation: Philadelphia PA, Mount Laurel, NJ (Hybrid)\n\nResponsibilities:\n• This role will focus on the technical processes related to software development and will assist in maintaining the high quality of new software systems, ensuring the software project security, and work to keep new technology by utilization of new tools and trends\n• Write effective APIs contracts and API implementations.\n• Participating in the design and creation of scalable software\n• Work as part of a development team in a fast paced environment\n\nRequired Qualifications:\n• 7 to 10 years of software development experience\n• Proven experience as a Full Stack Developer or similar role\n• Knowledge of front-end JavaScript frameworks (e.g., Angular, React, Next.js, Node.js)\n• Knowledge of back-end development with Python and Node\n• Familiarity with databases (e.g., MYSQL and LDAP) and UI/UX design\n• Knowledge of professional software engineering practices & standard methodologies for the full software creation process, including coding standards, code reviews, source control management (Git, Gitlow), build processes (Maven), testing, and operations.\n• Experience debugging and performance tuning applications and services.\n• Familiarity with DevSecOps, automation releases, CI/CD pipelines would be an added advantage.\n• Working experience writing programmatic compliance checks\n• Expertise in ReactJS and Node. JS development\n• Expertise in UI development using ReactJS, have expertise in HTML5/CSS3Expertise in client-side JavaScript framework like React, jQuery\n• Experience in building Node. JS concepts (Such as event loop, cluster, memory management)Strong experience of building RESTful web services\n• Strong experience in RDBMS databases\n• Excellent communication and collaboration skills\n• Great attention to detail\n\nBenefits: Cognizant offers the following benefits for this position, subject to applicable eligibility requirements:\n• Medical/Dental/Vision/Life Insurance\n• Paid holidays plus Paid Time Off\n• 401(k) plan and contributions\n• Long-term/Short-term Disability\n• Paid Parental Leave\n• Employee Stock Purchase Plan\n\nApplications will be accepted until 04/29/2024.\n\nThe annual salary for this position is between $107,000 – $130,000.00 depending on experience and other qualifications of the successful candidate.\n\nWhy Chose Cognizant?\n\nOur associates enjoy robust benefits and training opportunities from our industry recognized, award winning Academy team. You will have access to hundreds of technical trainings to keep your abilities fresh and have opportunities to acquire certifications on the newest technologies.\n\nIf you became comfortable with ambiguity, delight by change, and excel through autonomy, we’d love to hear from you!\n\nCognizant is an equal opportunity employer provider and committed to creating a diverse environment. We consider all applicants without regard to race, creed, color, national origin, ancestry, age, marital and family status, disabilities, sexual orientation or preference, veteran status or any other classification protected by state, federal or local law.\n\nAbout Cognizant:\n\nHeadquartered in the U.S, Cognizant leverages a highly flexible business model, a flawless global delivery network, and deep domain expertise to deliver to a long list of world-class companies that are leaders in their own space.\n\nwww.cognizant.com',
